class Productos extends Component {

    render() { 
        return ( 
            <div className="productos">
                <h2>Nuestros Productos</h2>
                <Buscador 
                    busqueda = {this.props.busquedaProducto}
                />
                <ul className="lista-productos">

                </ul>
            </div>
         );
    }
}

export default Productos;
